describe('Get DeleteDriver Info', function() {
    it('Should Return DeleteDriver Info', function() {
       response.should.have.status(200);
       response.should.be.json;
       response.body.should.not.be.empty;
    });
     it('Should Have a Valid DeleteDriverMessage  ', function() {
      var alertResponse = response.body;
      alertResponse.should.be.an('object');
      alertResponse.should.have.property('Message').and.not.empty;

     });
});

